import React from 'react';

const LandingPage = () => {
  return (
    <div>
      <h1>Welcome to Our Nonprofit Maintenance Request Form</h1>
      <p>We are glad you're here! Please fill out the form below to submit your maintenance request.</p>
    </div>
  );
};

export default LandingPage;
